INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, "カオリ（サマー）", 4, 110501, 24015, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, "カオリ（サマー）", 4, 110501, 24016, 0.0, "2030/12/17 14:59:59", 0.0, 1, 4.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, "カオリ（サマー）", 4, 110501, 24017, 0.0, "2030/12/17 14:59:59", 0.0, 4, 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, "カオリ（サマー）", 1, 110501, 24018, 0.0, "2030/12/17 14:59:59", 0.0, 2, 5.2);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, "カオリ（サマー）", 5, 110501, 24019, 0.0, "2030/12/17 14:59:59", 0.0, 6, 4.2);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, "カオリ（サマー）", 2, 110501, 24020, 0.0, "2030/12/17 14:59:59", 0.0, 2, 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, "カオリ（サマー）", 1, 110501, 24021, 0.0, "2030/12/17 14:59:59", 0.0, 6, 6.4);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, "カオリ（サマー）", 2, 110501, 24022, 0.0, "2030/12/17 14:59:59", 0.0, 2, 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, "カオリ（サマー）", 6, 110501, 24023, 0.0, "2030/12/17 14:59:59", 0.0, 3, 10.08);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, "カオリ（サマー）", 1, 110501, 24024, 0.0, "2030/12/17 14:59:59", 0.0, 2, 5.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("2019/07/31 12:00:00", 10021, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, "カオリ（サマー）", 2, 110501, 24025, 0.0, "2030/12/17 14:59:59", 0.0, 2, 0.0);
